(0, './files/UU 062014(1).pdf', 'udang-undang', ' \nSALI\nNAN\n \nUNDAN\nG\n-\nUNDANG REPUBLIK INDONESIA \n \nNOMOR\n \n6 \nTAHUN\n \n2014\n \nTENTANG\n \nDESA\n \n \nDENGAN RAHMAT TUHAN YANG MAHA ESA\n \n \n \nPRESIDEN REPUBLIK INDONESIA,\n \n \n \nMenimbang\n \n:\n \na.\n \nbahwa Desa memiliki hak asal usul dan hak tradisional \ndalam mengatur dan mengurus kepentingan masyarakat \nse\ntempat dan berperan mewujudkan cita\n-\ncita \nkemerdekaan berdasarkan Undang\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945;\n \nb.\n \nbahwa dalam perjalanan ketatanegaraan Republik \nIndonesia, Desa telah berkembang dalam berbagai \nbentuk sehingga perlu dilindungi da\nn diberdayakan \nagar menjadi kuat, maju, mandiri, dan demokratis \nsehingga dapat menciptakan landasan yang kuat \n   \ndalam\n \nmelaksanakan\n \npemerintahan dan \npembangunan menuju masyarakat yang adil, \nmakmur, dan  sejahtera;\n \nc.\n \nbahwa Desa dalam susunan dan tata cara \npenyelenggaraan pemerintahan dan pembangunan\n \nperlu \ndiatur tersendiri dengan\n \nundang\n-\nundang\n;\n \n \nd.\n \nbahwa berdasarkan pertimbangan sebagaimana \ndimaksud dalam huruf a, huruf b, dan huruf c perlu \nmembentuk Undang\n-\nUndang tentang Desa\n;\n \n \nMengingat\n \n:\n \nPasal 5\n \nayat (1)\n, Pasal 18, Pasal 18B ayat (2), Pasal 20, dan \n              \nPasal 22D ayat (2) Undang\n-\nUndang Dasar Negara Republik \nIndonesia Tahun 1945;\n \n \n \n \n \n \n \nDengan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n2 \n-\n \n \nDengan Persetujuan Bersama\n \nDEWAN PERWAKILAN RAKYAT REPUBLIK INDONESIA\n \ndan\n \nPRESIDEN REPUBLIK INDONESIA\n \n \nMEMUTUSKA\nN\n:\n \n \n \nMenetapkan\n \n:\n \nUNDANG\n-\nUNDANG TENTANG DESA.\n \n \nBAB I\n \nKETENTUAN UMUM\n \n \nPasal 1\n \nDalam Undang\n-\nU\nndang ini yang dimaksud dengan:\n \n1.\n \nDesa \nadalah desa dan desa adat \natau yang disebut \ndengan nama lain, selanjutnya disebut Desa, adalah \nkesatuan masyarakat hukum yang m\nemiliki batas \nwilayah yang berwenang untuk mengatur dan \nmengurus urusan pemerintahan\n,\n \nkepentingan \nmasyarakat setempat berdasarkan prakarsa \nmasyarakat, hak asal\n \nusul\n, dan/atau hak tradisional\n \nyang diakui dan dihormati dalam sistem \np\nemerintahan Negara Kesatu\nan Republik Indonesia.\n \n2.\n \nPemerintahan Desa adalah penyelenggaraan urusan \npemerintahan\n \ndan kepentingan masyarakat setempat \ndalam \nsistem\n \npemerintahan Negara Kesatuan \nRepublik Indonesia.\n \n3.\n \nPemerintah Desa adalah Kepala Desa atau yang \ndisebut dengan nama lain diba\nntu perangkat Desa \nsebagai unsur \npenyelenggara\n \nPemerintahan Desa. \n \n4.\n \nBadan Permusyawaratan Desa atau yang disebut \ndengan \nnama\n \nlain \nadalah\n \nlembaga yang melaksanakan \nfungsi pemerintahan yang anggotanya merupakan \nwakil dari penduduk Desa berdasarkan keterwakila\nn \nwilayah dan ditetapkan secara demokratis.  \n \n \n5. Musyawarah \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n3 \n-\n \n \n5.\n \nMusyawarah Desa atau yang disebut dengan nama \nlain adalah \nmusyawarah\n \nantara Badan \nPermusyawaratan Desa, \nPemerintah\n \nDesa, dan unsur \nmasyarakat yang diselenggarakan oleh Badan \nPermusyawaratan Desa untuk menyepa\nkati hal yang \nbersifat strategis. \n \n6.\n \nBadan Usaha Milik Desa, yang selanjutnya disebut \nBUM Desa, adalah badan usaha yang seluruh atau \nsebagian \nbesar\n \nmodalnya\n \ndimiliki oleh Desa melalui \npenyertaan secara langsung yang berasal dari \nkekayaan Desa yang dipisahkan\n \nguna mengelola aset, \njasa pelayanan, dan usaha lainnya untuk sebesar\n-\nbesarnya kesejahteraan masyarakat Desa. \n \n7.\n \nPeraturan Desa adalah peraturan perundang\n-\nundangan yang \nditetapkan\n \noleh Kepala Desa setelah \ndibahas dan \ndisepakati\n \nbersama Badan \nPermusyawaratan \nDesa. \n \n8.\n \nPembangunan Desa adalah upaya peningkatan \nkualitas hidup dan kehidupan untuk sebesar\n-\nbesarnya kesejahteraan \nmasyarakat\n \nDesa.\n \n9.\n \nKawasan Perdesaan adalah kawasan yang mempunyai \nkegiatan utama pertanian, termasuk pengelolaan \nsumber\n \ndaya alam dengan susun\nan fungsi kawasan \nsebagai tempat permukiman perdesaan, pelayanan \njasa pemerintahan, pelayanan sosial, dan kegiatan \nekonomi.\n \n10.\n \nKeuangan Desa adalah semua hak dan kewajiban \nDesa yang dapat dinilai dengan uang serta segala \nsesuatu berupa uang \ndan\n \nbarang yang be\nrhubungan \ndengan pelaksanaan hak dan kewajiban Desa.\n \n11.\n \nAset Desa adalah barang milik Desa yang berasal dari \nkekayaan \nasli\n \nDesa\n, dibeli atau diperoleh atas beban \nAnggaran Pendapatan dan Belanja Desa atau \nperolehan hak lainnya yang sah. \n \n \n \n \n \n12. Pemberdayaan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n4 \n-\n \n \n12.\n \nPemberdayaan Masy\narakat Desa adalah upaya \nmengembangkan\n \nkemandirian dan kesejahteraan \nmasyarakat dengan meningkatkan pengetahuan, \nsikap, keterampilan, perilaku, kemampuan, \nkesadaran, serta \nmemanfaatkan sumber daya\n \nmelalui \npenetapan kebijakan, program, kegiatan, dan \npendamp\ningan yang sesuai dengan esensi masalah \ndan prioritas kebutuhan masyarakat Desa.\n \n13.\n \nPemerintah Pusat selanjutnya disebut Pemerintah \nadalah Presiden Republik Indonesia yang memegang \nkekuasaan pemerintahan negara Republik Indonesia \nsebagaimana dimaksud dalam Un\ndang\n-\nUndang Dasar \nNegara Republik Indonesia Tahun 1945.\n \n14.\n \nPemerintahan Daerah adalah Pemerintah Daerah dan \nDewan Perwakilan Rakyat Daerah yang \nmenyelenggarakan\n \nurusan pemerintahan menurut \nasas otonomi dan tugas pembantuan dengan prinsip \notonomi seluas\n-\nluasny\na dalam sistem dan prinsip \nNegara Kesatuan Republik Indonesia sebagaimana \ndimaksud dalam Undang\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945.\n \n15.\n \nPemerintah Daerah adalah Gubernur, Bupati, atau \nWalikota \ndan\n \nperangkat daerah sebagai unsur \npenyelenggara Pem\nerintahan Daerah\n.\n \n16.\n \nMenteri\n \nadalah\n \nm\nenteri yang \nmenangani Desa.\n \n \n \nPasal 2\n \nPenyelenggaraan Pemerintahan Desa, pelaksanaan \nPembangunan Desa, pembinaan kemasyarakatan Desa, \ndan pemberdayaan masyarakat Desa berdasarkan \nPancasila, Undang\n-\nUndang Dasar Negara Repub\nlik \nIndonesia Tahun 1945, Negara Kesatuan Republik \nIndonesia, dan Bhinneka Tunggal Ika.\n \n \n \n \n \n \n \n \nPasal 3 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n5 \n-\n \n \nPasal 3\n \nP\nengaturan Desa \nberasaskan\n:\n \na.\n \nr\nekognisi\n;\n \nb.\n \ns\nubsidiaritas\n;\n \nc.\n \nkeberagaman;\n \nd.\n \nkebersamaan; \n \ne.\n \nkegotongroyongan;\n \nf.\n \nkekeluargaan;\n \ng.\n \nmusyawarah;\n \nh.\n \ndemokrasi\n;\n \ni.\n \nkemandirian;\n \nj.\n \npar\ntisipasi; \n \nk.\n \nkesetaraan; \n \nl.\n \npemberdayaan\n; dan\n \nm.\n \nkeberlanjutan.\n \n \nPasal \n4\n \nPengaturan \nDesa\n \nbertujuan:\n \na.\n \nmemberikan pengakuan dan penghormatan atas \nDesa\n \nyang \nsudah \nada\n \ndengan keberagamannya \nsebelum dan \nsesudah terbentuknya Negara Kesatuan Republik \nIndonesia\n;\n \nb.\n \nm\nemberika\nn\n \nkejelasan status dan kepastian hukum \natas Desa dalam sistem ketatanegaraan Republik \nIndonesia demi mewujudkan keadilan bagi seluruh \nrakyat Indonesia;\n \nc.\n \nmelestarikan dan memajukan adat, tradisi, dan \nbudaya masyarakat Desa;\n \nd.\n \nmendorong prakarsa, gerakan, dan p\nartisipasi \nmasyarakat Desa untuk pengembangan potensi dan \nA\nset Desa guna kesejahteraan bersama;\n \ne.\n \nmembentuk Pemerintahan \nDesa\n \nyang profesional, \nefisien \ndan \nefektif\n, \nterbuka\n, serta \nbertanggung jawab;\n \nf. meningkatkan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n6 \n-\n \n \nf.\n \nmeningkatkan pelayanan publik bagi \nwarga \nmasyarakat\n \nDesa\n \ng\nuna mempercepat perwujudan \nkesejahteraan \numum;\n \ng.\n \nmeningkatkan ketahanan sosial\n \nbudaya masyarakat \nDesa \nguna mewujudkan masyarakat \nDesa \nyang \nmampu memelihara kesatuan sosial sebagai bagian \ndari ketahanan nasional\n; \n \nh.\n \nmemajukan perekonomian masyarakat Desa serta \nm\nengatasi kesenjangan pembangunan\n \nnasional; dan              \n \ni.\n \nmemperkuat masyarakat Desa sebagai subjek \npembangunan.\n \n \n \nBAB II\n \nKEDUDUKAN\n \nDAN\n \nJENIS DESA\n \n \nBagian Kesatu\n \nKedudukan\n \n \nPasal 5\n \nDesa berkedudukan di wilayah \nKabupaten/Kota\n. \n \n \nBagian Kedua\n \nJenis Desa\n \n \nPasal \n6\n \n(1)\n \nDesa terdiri atas \nDesa\n \ndan Desa Adat\n. \n \n(2)\n \nPenyebutan Desa atau Desa Adat sebagaimana \ndimaksud pada ayat (1) disesuaikan dengan \npenyebutan \nyang\n \nberlaku di daerah setempat.\n \n \nBAB \nIII\n \nPENATAAN DESA \n \n \nPasal \n7\n \n(1)\n \nPem\nerintah, P\nemerintah Daerah Provinsi, \ndan \nP\ne\nmerintah Daerah \nKabupaten/Kota \ndapat \nmelakukan penataan Desa.\n \n \n(2) Penataan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n7 \n-\n \n \n(2)\n \nPenataan sebagaimana dimaksud pada ayat (1) \nberdasarkan hasil evaluasi tingkat perkembangan \nPemerintahan\n \nDesa sesuai dengan ketentuan \nperaturan perundang\n-\nundangan.\n \n(3)\n \nPenataan\n \nsebagaimana dimaksu\nd pada ayat (1) \nber\ntujuan:\n \na.\n \nmewujudkan efektivitas penyelenggaraan \nPemerintahan Desa\n;\n \nb.\n \nmempercepat peningkatan kesejahteraan \nmasyarakat Desa;\n \nc.\n \nm\nempercepat peningkatan kualitas pelayanan \npubli\nk;\n \nd.\n \nmeningkatkan kualitas tata kelola \nP\nemerintahan\n \nDesa\n; dan\n \ne.\n \nmeningka\ntkan daya saing Desa. \n \n(4)\n \nPenataan\n \nsebagaimana dimaksud pada ayat (1) \nmeliputi\n:\n \na.\n \npembentukan; \n \nb.\n \npenghapusan;\n \nc.\n \npenggabungan; \n \nd.\n \nperubahan status;\n \ndan\n \ne.\n \npenetapan Desa.\n \n \n \n \nPasal \n8\n \n(1)\n \nPembentukan Desa sebagaimana dimaksud dalam\n \n \nPasal 7 ayat (4) huruf a merupakan tindakan\n \nmengadakan Desa baru di luar Desa yang ada.\n \n(2)\n \nPembentukan \nDesa sebagaimana dimaksud pada\n    \n \nayat (1) \nditetapkan\n \ndengan Peraturan Daerah \nKabupaten/Kota \ndengan\n \nmempertimbangkan\n \nprakarsa masyarakat\n \nDesa\n,\n \nasal\n \nusul, adat istiadat, \nkondisi sosial\n \nbudaya masyara\nkat \nDesa\n,\n \nserta \nkemampuan dan potensi Desa\n. \n \n(3)\n \nPembentukan Desa sebagaimana dimaksud pada \n       \nayat (1) harus \nmemenuhi\n \nsyarat:\n \na. batas \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n8 \n-\n \n \na.\n \nbatas usia Desa \ninduk paling sedikit \n5 (lima)\n \ntahun \nterhitung sejak pembentukan;\n \nb.\n \njumlah\n \npenduduk, yaitu: \n \n1)\n \nwilayah Jaw\na \npaling se\ndikit \n6.000 (enam ribu) \njiwa \natau \n1.200 (seribu dua ratus) k\nepala \nk\neluarga\n;\n \n2)\n \nwilayah \nBali \npaling sedikit \n5.000 (lima ribu) \njiwa \natau \n1.000 (seribu) k\nepala \nk\neluarga\n;\n \n3)\n \nwilayah Sumatera paling sedikit \n4.000 (empat ribu)\n \njiwa atau \n8\n00 \n(delapan ratus) k\nepala \nk\nelu\narga\n;\n \n4)\n \nwilayah\n \nSulawesi Selatan dan Sulawesi Utara \npaling sedikit \n3.000 (tiga ribu)\n \njiwa atau \n6\n00 \n(enam \nratus) k\nepala \nk\neluarga\n;\n \n5)\n \nw\nilayah \nNusa Tenggara\n \nBarat \npaling sedikit\n            \n \n2.500 (dua ribu lima ratus)\n \njiwa atau \n5\n00 \n(lima \nratus) k\nepala \nk\neluarga\n;\n \n6)\n \nwi\nlayah\n \nSulawesi Tengah, Sulawesi Barat, \nSulawesi Tenggara, Gorontalo, dan Kalimantan \nSelatan \npaling sedikit \n2.000 (dua ribu)\n \njiwa atau \n4\n00 \n(empat ratus) k\nepala \nk\neluarga\n;\n \n7)\n \nwilayah Kalimantan Timur, Kalimantan Barat, \nKalimantan Tengah, dan Kalimantan Utara \npal\ning \nsedikit \n1.500 (seribu lima ratus)\n \njiwa atau \n3\n00\n \n(tiga \nratus)\n \nk\nepala \nk\neluarga;\n \n8)\n \nwilayah \nNusa Tenggara\n \nTimur, Maluku, dan \nMaluku Utara \npaling sedikit \n1.000 (seribu)\n \njiwa \natau \n2\n00 \n(dua ratus) k\nepala \nk\neluarga\n; dan\n \n9)\n \nwilayah Papua dan Papua Barat paling sediki\nt\n         \n \n500 (lima ratus) jiwa atau 100 (seratus) kepala \nkeluarga\n.\n \nc.\n \nwilayah kerja \nyang \nmemiliki \nakses transportasi \nantarwilayah\n;\n \nd.\n \nsosial budaya yang dapat menciptakan kerukunan hidup \nbermasyarakat\n \nsesuai\n \ndengan\n \nadat istiadat \nDesa\n;\n \ne.\n \nmemiliki potensi yang mel\niputi sumber daya alam, \nsumber daya \nmanusia\n,\n \ndan sumber daya ekonomi \npendukung;\n \nf.\n \nbatas \nwilayah Desa\n \nyang dinyatakan dalam bentuk \npeta \nDesa\n \nyang\n \ntelah ditetapkan dalam \np\neraturan \nBupati/Walikota\n; \n \ng. sarana \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n9 \n-\n \n \ng.\n \nsarana dan prasarana bagi Pemerintahan Desa \ndan \npelayanan pub\nlik\n; dan\n \nh.\n \ntersedianya\n \ndana operasional\n,\n \npenghasilan tetap\n,\n \ndan tunjangan\n \nlainnya\n \nbagi perangkat Pemerintah \nDesa sesuai dengan\n \nketentuan\n \nperaturan \nperundang\n-\nundangan.\n \n(4)\n \nDalam wilayah Desa dibentuk dusun atau yang \ndisebut dengan \nnama\n \nlain yang disesuaikan denga\nn \nasal usul, adat istiadat, dan nilai sosial budaya \nmasyarakat Desa.\n \n(5)\n \nPembentukan Desa sebagaimana dimaksud pada\n          \n \nayat (1) \ndilakukan\n \nmelalui Desa persiapan.\n \n(6)\n \nDesa persiapan merupakan bagian dari wilayah Desa \ninduk.\n \n(7)\n \nDesa persiapan sebagaimana dimaksu\nd pada ayat (5) \ndapat \nditingkatkan\n \nstatusnya menjadi Desa dalam \njangka waktu 1 (satu) sampai 3 (tiga) tahun. \n \n(8)\n \nPeningkatan\n \nstatus sebagaimana dimaksud pada\n           \n \nayat (7) \ndilaksanakan\n \nberdasarkan hasil evaluasi. \n \n \nPasal \n9\n \nDesa dapat dihapus karena benc\nana alam dan/atau \nkepentingan program nasional yang strategis.\n \n \nPasal 10\n \nDua Desa atau lebih yang berbatasan dapat digabung \nmenjadi Desa baru berdasarkan kesepakatan Desa yang \nbersangkutan dengan memperhatikan persyaratan yang \nditentukan dalam Undang\n-\nUndan\ng ini.\n \n \nPasal \n11\n \n(1)\n \nDesa dapat berubah status menjadi kelurahan \nberdasarkan prakarsa Pemerintah Desa dan Badan \nPermusyawaratan Desa melalui Musyawarah Desa \ndengan memperhatikan saran dan pendapat \nmasyarakat Desa\n.\n \n \n \n(2) Seluruh \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n10 \n-\n \n \n(2)\n \nSeluruh barang milik Desa\n \ndan sumber pendap\natan \nDesa yang berubah menjadi kelurahan sebagaimana \ndimaksud pada ayat (1) menjadi kekayaan/aset \nPemerintah Daerah Kabupaten/Kota yang digunakan \nuntuk meningkatkan kesejahteraan masyarakat di \nkelurahan tersebut dan pendanaan kelurahan \ndibebankan pada Angg\naran Pendapatan dan Belanja \nDaerah Kabupaten/Kota.\n \n \nPasal \n12\n \n(1)\n \nPemerintah Daerah Kabupaten/Kota dapat mengubah \nstatus kelurahan menjadi Desa berdasarkan prakarsa \nmasyarakat dan memenuhi persyaratan yang \nditentukan sesuai dengan ketentuan peraturan \nperundang\n-\nundangan.\n \n(2)\n \nKelurahan \nyang berubah status menjadi \nDesa\n, \nsarana \ndan prasarana \nmenjadi \nmilik\n \nDesa \ndan dikelola oleh \nDesa\n \nyang bersangkutan untuk kepentingan \nmasyarakat \nDesa\n.\n \n \n(3)\n \nPendanaan perubahan status\n \nkelurahan sebagaimana \ndimaksud pada ayat (1) dibebankan pa\nda Anggaran \nPendapatan dan Belanja Daerah\n \nKabupaten/Kota\n.\n \n \nPasal 1\n3\n \nPemerintah\n \ndapat memprakarsai pembentukan Desa di \nkawasan yang bersifat khusus dan strategis bagi \nkepentingan nasional.\n \n \nPasal 14\n \nPembentukan, penghapusan, penggabungan, dan/atau \nperubahan\n \nstatus Desa menjadi kelurahan sebagaimana \ndimaksud dalam Pasal 8, Pasal 9, Pasal 10, dan Pasal 11 \natau kelurahan menjadi Desa sebagaimana dimaksud \ndalam P\nasal 12 \nditetapkan dalam Peraturan Daerah.\n \n \n \n \n \n \nPasal 15 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n11 \n-\n \n \nPasal 15\n \n(1)\n \nRancangan Peraturan Daerah tentang \npembentu\nkan, \npenghapusan, penggabungan, dan/atau perubahan \nstatus Desa menjadi kelurahan atau kelurahan \nmenjadi Desa sebagaimana dimaksud dalam Pasal 14 \nyang telah mendapatkan persetujuan \nbersama\n \nBupati/Walikota dengan Dewan Perwakilan Rakyat \nDaerah diajukan kepad\na Gubernur\n.\n \n(2)\n \nGubernur melakukan evaluasi Rancangan Peraturan \nDaerah tentang \npembentukan, penghapusan, \npenggabungan, dan/atau perubahan status Desa \nmenjadi kelurahan \natau\n \nkelurahan menjadi Desa \nsebagaimana dimaksud pada  ayat (1) berdasarkan \nurgensi, kepenti\nngan nasional, kepentingan daerah, \nkepentingan masyarakat Desa, dan/atau peraturan \nperundang\n-\nundangan.\n \n \nPasal 1\n6\n \n(1)\n \nGubernur menyatakan persetujuan terhadap \nRancangan Peraturan Daerah sebagaimana dimaksud \ndalam Pasal 15 paling lama 20 (dua puluh) hari \nsetelah\n \nmenerima Rancangan Peraturan Daerah.\n \n(2)\n \nDalam hal Gubernur memberikan persetujuan atas \nRancangan Peraturan Daerah sebagaimana dimaksud \npada ayat (1), Pemerintah Daerah Kabupaten/Kota \nmelakukan penyempurnaan dan penetapan menjadi \nPeraturan Daerah paling lama \n20 (dua puluh) hari.   \n \n(3)\n \nDalam hal Gubernur menolak memberikan \npersetujuan terhadap Rancangan Peraturan Daerah \nsebagaimana dimaksud pada ayat (1), Rancangan \nPeraturan Daerah tersebut \ntidak\n \ndapat disahkan dan \ntidak dapat diajukan kembali dalam waktu 5 (lima)\n \ntahun setelah penolakan oleh Gubernur.\n \n(4)\n \nDalam hal Gubernur tidak memberikan persetujuan \natau tidak memberikan penolakan terhadap \nRancangan Peraturan Daerah yang dimaksud dalam \nPasal 15 dalam jangka waktu sebagaimana dimaksud \npada ayat (1), Bupati/Walikota\n \ndapat mengesahkan \nRancangan Peraturan Daerah tersebut serta sekretaris \ndaerah mengundangkannya dalam Lembaran Daerah.\n \n(5) Dalam \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n12 \n-\n \n \n(5)\n \nDalam hal Bupati/Walikota tidak menetapkan \nRancangan Peraturan \nDaerah\n \nyang telah disetujui oleh \nGubernur, Rancangan Peraturan Daerah ters\nebut \ndalam jangka waktu 20 (dua puluh) hari setelah \ntanggal persetujuan Gubernur dinyatakan berlaku \ndengan sendirinya.\n \nPasal 17\n \n(1)\n \nPeraturan Daerah \nKabupaten/Kota \ntentang \npembentukan, penghapusan, penggabungan, dan \nperubahan status Desa menjadi kelurahan atau\n \nkelurahan menjadi Desa diundangkan setelah \nmendapat nomor registrasi dari Gubernur dan kode \nDesa dari Menteri. \n \n(2)\n \nPeraturan Daerah \nKabupaten/Kota \nsebagaimana \ndimaksud pada ayat (1) disertai lampiran peta batas \nwilayah Desa.\n \n \n \nBAB\n \nI\nV\n \nKEWENANGAN DESA\n \n \nPasal \n1\n8\n \nKewen\na\nngan \nDesa\n \nmeliputi\n \nkewenangan di bidang \np\nenyelenggaraan Pemerintahan Desa, pelaksanaan \nPembangunan Desa, pembinaan kemasyarakatan Desa, dan \npemberdayaan masyarakat Desa berdasarkan prakarsa \nmasyarakat, \nhak \nasa\nl \nusul\n,\n \ndan adat istiadat \nDesa.\n \n \nPasal \n19\n \nKewenangan \nDesa\n \nmeliputi: \n \na.\n \nkewenangan berdasarkan hak asal usul; \n \nb.\n \nkewenangan lokal berskala Desa; \n \nc.\n \nkewenangan yang ditugaskan oleh Pemerintah, \nPemerintah Daerah Provinsi, atau Pemerintah Daerah \nKabupaten/Kota\n; dan\n \nd.\n \nkewenangan lain yang ditugaskan oleh P\nemerintah, \nPemerintah Daerah Provinsi, atau Pemerintah Daerah \nKabupaten/Kota \nsesuai dengan ketentuan peraturan \nperundang\n-\nundangan.\n \nPasal 20 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n13 \n-\n \n \nPasal 20\n \nPelaksanaan kewenangan berdasarkan hak asal usul dan \nkewenangan lokal berskala Desa sebagaimana dimaksud \ndalam Pasal\n \n19 huruf a dan huruf b diatur dan diurus \noleh Desa. \n \n \nPasal 21\n \nPelaksanaan kewenangan yang ditugaskan dan \npelaksanaan kewenangan tugas lain dari Pemerintah, \nPemerintah Daerah Provinsi, atau Pemerintah Daerah \nKabupaten/Kota \nsebagaimana dimaksud dalam Pasal\n \n19 \nhuruf c dan huruf d diurus oleh Desa.\n \n \nPasal 22\n \n(1)\n \nPenugasan dari Pemerintah dan/atau Pemerintah \nDaerah kepada Desa meliputi penyelenggaraan \nPemerintahan Desa, pelaksanaan Pembangunan Desa, \npembinaan kemasyarakatan Desa, dan pemberdayaan \nmasyarakat Desa. \n \n(2)\n \nPenugasan  sebagaimana dimaksud pada ayat (1) \ndisertai biaya\n.\n \n \nB\nAB V\n \nPENYELENGGARAAN \nPEMERINTAHAN DESA\n \n \nPasal \n2\n3\n \nPemerintahan Desa \ndiselenggarakan \noleh \nPemerintah \nDesa\n.\n \n \nPasal \n2\n4\n \nPenyelenggaraan\n \nPemerintahan Desa \nber\ndasarkan \nasas\n:\n \na.\n \nkepastian hukum;\n \nb.\n \ntertib \npenyelenggara\nan\n \npemerintahan\n;\n \nc.\n \ntertib kepentingan umum;\n \nd.\n \nketerbukaan;\n \ne.\n \nproporsionalitas;\n \nf.\n \nprofesionalitas;\n \ng. akuntabilitas \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n14 \n-\n \n \ng.\n \nakuntabilitas;\n \nh.\n \nefekt\nivitas dan efisiensi\n;\n \n \ni.\n \nkearifan lokal; \n \nj.\n \nkeberagaman; dan\n \nk.\n \npartisipatif.\n \n \nBagian Kesatu\n \n \nPemerintah Desa \n \n \nPasal \n2\n5\n \nPemerintah Desa se\nbagaimana dimaksud dalam Pasal\n \n23 \nadalah Kepala Desa\n \natau yang disebut dengan nama lain \ndan yang dibantu oleh perangkat Desa atau yang disebut \ndengan nama lain\n.\n \n \nBagian Kedua\n \nKepala Desa\n \n \nPasal \n2\n6\n \n(1)\n \nKepala Desa bertugas menyelenggarakan \nPemerintahan \nDesa, me\nlaksanakan P\nembangunan Desa, pembinaan \nkemasyarakatan Desa, dan \np\nemberdayaan \nm\nasyarakat \nDesa\n.\n \n(2)\n \nDalam melaksanakan tugas sebagaimana dimaksud \npada ayat (1), Kepala \nDesa\n \nberwenang:\n \na.\n \nmemimpin penyelenggaraan \nP\nemerintahan\n \nDesa\n;\n \nb.\n \nmengangkat dan memberhentikan pera\nngkat Desa; \n \nc.\n \nmemegang kekuasaan pengelolaan \nKeuangan \ndan \nA\nset Desa;\n \n \nd.\n \nmenetapkan Peraturan Desa\n;\n \n \ne.\n \nmenetapkan \nAnggaran Pendapatan dan Belanja \nDesa\n; \n \nf.\n \n \nmembina kehidupan masyarakat Desa;\n \ng.\n \nmembina ketenteraman dan ketertiban \nmasyarakat Desa;\n \n \nh. membina \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n15 \n-\n \n \nh.\n \nmembina\n \ndan \nmening\nkatkan perekonomian Desa\n \nserta \nmengintegrasikannya agar mencapai perekonomian \nskala produktif untuk sebesar\n-\nbesarnya kemakmuran \nmasyarakat Desa\n;\n \ni.\n \n \nmengembangkan sumber pendapatan Desa;\n \nj.\n \n \nmengusulkan dan menerima pelimpahan \nsebagian kekayaan negara guna menin\ngkatkan \nkesejahteraan masyarakat Desa;\n \nk.\n \nmengembangkan kehidupan sosial budaya \nmasyarakat Desa;\n \nl.\n \n \nmemanfaatkan teknologi tepat guna;\n \nm.\n \nmengoordinasikan \nP\nembangunan Desa secara \npartisipatif;\n \nn.\n \nmewakili Desa di dalam dan di luar pengadilan atau \nmenunjuk kuasa hukum\n \nuntuk mewakilinya sesuai \ndengan \nketentuan \nperaturan perundang\n-\nundangan; \ndan\n \no.\n \nmelaksanakan wewenang lain yang \nsesuai dengan \nketentuan \nperaturan perundang\n-\nundangan\n.\n \n(3)\n \nDalam melaksanakan tugas sebagaimana dimaksud \npada ayat (1), Kepala Desa\n \nberhak:\n \na.\n \nm\nengusulkan \nstruktur organisasi dan tata kerja \nPemerintah\n \nDesa;\n \nb.\n \nmengajukan rancangan\n \ndan menetapkan\n \nPeraturan Desa;\n \nc.\n \nmenerima penghasilan tetap setiap bulan\n,\n \ntunjangan\n, dan \n \npenerimaan lainnya yang sah, \nserta mendapat jaminan kesehatan;\n \n \nd.\n \nmendapatkan pelindungan hukum a\ntas kebijakan \nyang dilaksanakan; \ndan\n \ne.\n \nmemberikan mandat pelaksanaan tugas dan \nkewajiban lainnya kepada perangkat Desa\n.\n \n \n \n \n \n(4) Dalam \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n16 \n-\n \n \n(4)\n \nDalam \nmelaksanakan\n \ntugas sebagaimana dimaksud \npada ayat (1), Kepala Desa\n \nberke\nwajib\nan\n:\n \na.\n \nmemegang teguh dan mengamalkan Pancasila,  \nmel\naksanakan Undang\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945, serta \nmempertahankan dan memelihara keutuhan \nNegara Kesatuan Republik Indonesia, dan \nBhinneka Tunggal Ika;\n \nb.\n \nmeningkatkan kesejahteraan masyarakat\n \nDesa\n;\n \nc.\n \nmemelihara ketenteraman dan ketertiba\nn \nmasyarakat\n \nDesa\n;\n \nd.\n \nmenaati dan menegakkan peraturan perundang\n-\nundangan;\n \ne.\n \nmelaksanakan kehidupan demokrasi\n \ndan \nberkeadilan gender\n;\n \nf.\n \n \nmelaksanakan prinsip tata Pemerintahan Desa \nyang akuntabel, transparan, profesional, efektif \ndan efisien, bersih\n,\n \nserta \nbebas \ndari k\nolusi, \nk\norupsi\n,\n \ndan \nn\nepotisme;\n \ng.\n \nmenjalin kerja sama dan koordinasi dengan \nseluruh \npemangku kepentingan di Desa\n;\n \nh.\n \nmenyelenggarakan administrasi Pemerintahan \nDesa yang baik;\n \ni.\n \n \n \nmengelola Keuangan dan \nA\nset Desa; \n \nj.\n \n \n \nmelaksanakan urusan pemerintahan yang \nmen\njadi kewenangan Desa;\n \nk.\n \nmenyelesaikan perselisihan masyarakat di Desa;\n \nl.\n \n \n \nmengembangkan perekonomian masyarakat \nDesa;\n \nm.\n \nmembina dan melestarikan nilai sosial budaya\n \nmasyarakat Desa\n;\n \nn.\n \nmemberdayakan masyarakat dan lembaga \nkemasyarakatan di Desa; \n \no.\n \nmengembangkan pot\nensi sumber daya alam dan \nmelestarikan lingkungan hidup\n; \ndan\n \np.\n \nmemberikan informasi kepada masyarakat Desa.\n \nPasal 27 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n17 \n-\n \n \n \nPasal 27\n \nDalam melaksanakan tugas, kewenangan, hak, dan \nkewajiban sebagaimana dimaksud dalam Pasal 26, Kepala \nDesa wajib:\n \na.\n \nmenyampaikan laporan \npenye\nlenggaraan \nPemerintahan Desa setiap akhir tahun anggaran \nkepada \nBupati/Walikota;\n \nb.\n \nmenyampaikan laporan \npenyelenggaraan \nPemerintahan Desa pada akhir masa jabatan \nkepada \nBupati/Walikota;\n \nc.\n \nmemberikan laporan keterangan penyelenggaraan \npemerintahan secara tertul\nis kepada Badan \nPermusyawaratan Desa setiap akhir tahun anggaran; \ndan\n \nd.\n \nmemberikan dan/atau menyebarkan informasi \npenyelenggaraan pemerintahan secara tertulis kepada \nmasyarakat Desa setiap akhir tahun anggaran.\n \n \nPasal \n2\n8\n \n(1)\n \nKepala Desa yang tidak melaksanakan k\newajiban \nsebagaimana dimaksud dalam Pasal  26 ayat (4) dan \nPasal  27 dikenai sanksi administratif berupa teguran \nlisan dan/atau teguran tertulis.\n \n(2)\n \nDalam hal sanksi administratif sebagaimana \ndimaksud pada ayat (1) tidak dilaksanakan, dilakukan \ntindakan pembe\nrhentian sementara dan dapat \ndilanjutkan dengan pemberhentian.\n \n \nPasal \n2\n9\n \nKepala Desa\n \ndilarang:\n \na.\n \nmerugikan kepentingan umum;\n \nb.\n \nmembuat keputusan yang \nm\ne\nng\nuntun\ngk\nan diri \nsendiri, anggota keluarga\n, pihak lain, \ndan/atau \ngolongan tertentu;\n \nc.\n \nmenyalahgunakan wewenan\ng, tugas, hak\n,\n \ndan/atau \nkewajibannya; \n \nd. melakukan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n18 \n-\n \n \nd.\n \nmelakukan tindakan diskrimina\ntif\n \nterhadap warga \ndan/\natau golongan masyarakat tertentu;\n \ne.\n \nmelakukan tindakan meresahkan sekelompok \nmasyarakat Desa;\n \nf.\n \nmelakukan kolusi, korupsi, dan nepotisme, menerima \nuang, barang\n,\n \ndan/ata\nu jasa dari pihak lain yang \ndapat memengaruhi keputusan atau tindakan yang \nakan dilakukannya;\n \ng.\n \nmenjadi pengurus\n \npartai politik\n; \n \nh.\n \nmenjadi anggota dan/atau pengurus organisasi \nterlarang;\n \ni.\n \nmerangkap jabatan sebagai \nk\netua dan/atau \na\nnggota \nBadan Permusyawaratan D\nesa\n, anggota Dewan \nPerwakilan Rakyat\n \nRepublik Indonesia\n, Dewan \nPerwakilan Daerah\n \nRepublik Indonesia\n, D\newan \nPerwakilan Rakyat Daerah \nProvinsi atau D\newan \nPerwakilan Rakyat Daerah \nKabupaten/Kota\n, \ndan \njabatan lain yang ditentukan dalam peraturan \nperundangan\n-\nun\ndangan;\n \nj.\n \nikut serta dan/atau terlibat dalam kampanye\n \npemilihan umum\n \ndan/atau pemilihan \nkepala daerah;\n \n \nk.\n \nmelanggar sumpah/janji jabatan; dan\n \nl.\n \nmeninggalkan tugas selama \n30\n \n(\ntiga puluh\n) \nhari\n \nkerja \nberturut\n-\nturut tanpa alasan yang jelas\n \ndan tidak \ndapat dipertangg\nungjawabkan.\n \n \n \nPasal 30\n \n(1)\n \nKepala Desa yang melanggar larangan sebagaimana \ndimaksud dalam Pasal 29 dikenai sanksi administratif \nberupa teguran lisan dan/atau teguran tertulis.\n \n(2)\n \nDalam hal sanksi administratif sebagaimana \ndimaksud pada ayat (1) tidak dilaksanaka\nn, dilakukan \ntindakan pemberhentian sementara dan dapat \ndilanjutkan dengan pemberhentian.\n \n \n \n \n \nBagian \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n19 \n-\n \n \nBagian Ketiga\n \nPemilihan Kepala Desa\n \n \nPasal 31\n \n(1)\n \nPemilihan Kepala Desa dilaksanakan secara serentak \ndi seluruh wilayah Kabupaten/Kota. \n \n(2)\n \nPemerintahan Daerah Kabupate\nn/Kota menetapkan \nkebijakan pelaksanaan pemilihan Kepala Desa secara \nserentak sebagaimana dimaksud pada ayat (1) dengan \nPeraturan Daerah Kabupaten/Kota.\n \n(3)\n \nKetentuan lebih lanjut mengenai tata cara pemilihan \nKepala Desa serentak sebagaimana dimaksud pada \nayat\n \n(1) dan ayat (2) diatur \ndengan atau b\nerdasarkan \nPeraturan Pemerintah.\n \n \nPasal 32\n \n(1)\n \nBadan Permusyawaratan Desa memberitahukan \nkepada Kepala Desa mengenai akan berakhirnya masa \njabatan Kepala Desa secara tertulis 6 (enam) bulan \nsebelum masa jabatannya berakhir\n.\n \n(2)\n \nBadan Permusyawaratan Desa membentuk panitia \npemilihan Kepala Desa.\n \n(3)\n \nPanitia pemilihan Kepala Desa sebagaimana dimaksud \npada ayat (2) bersifat mandiri dan tidak memihak.\n \n(4)\n \nPanitia pemilihan Kepala Desa sebagaimana dimaksud \npada ayat (3) terdiri atas unsur p\nerangkat Desa, \nlembaga kemasyarakatan, dan tokoh masyarakat \nDesa. \n \n \nPasal \n3\n3\n \nCalon \nKepala Desa\n \nwajib memenuhi persyaratan:\n \na.\n \nw\narga \nn\negara Republik Indonesia;\n \nb.\n \nberta\nk\nwa kepada Tuhan Yang Maha Esa;\n \n \n \nc. memegang \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n20 \n-\n \n \nc.\n \nmemegang teguh dan mengamalkan Pancasila, \nmelaksanakan Undan\ng\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945, serta \nmempertahankan dan memelihara keutuhan Negara \nKesatuan Republik Indonesia\n \ndan Bhinneka Tunggal \nIka\n;\n \nd.\n \nberpendidikan paling rendah tamat sekolah menengah \npertama atau sederajat;\n \ne.\n \nberusia \npaling rendah \n25\n \n(dua puluh lima) t\nahun\n \npada \nsaat mendaftar;\n \nf.\n \nbersedia dicalonkan menjadi \nKepala Desa\n;\n \ng.\n \nterdaftar sebagai \npenduduk dan \nbertempat \n \ntinggal \ndi \nDesa setempat\n \npaling kurang 1 (satu) tahun sebelum \npendaftaran;\n \nh.\n \ntidak sedang menjalani hukuman pidana penjara;\n \ni.\n \ntida\nk pernah dijatuhi pidana penjara\n \nberdasarkan \nputusan pengadilan yang telah \nmempunyai\n \nkekuatan \nhukum tetap karena melakukan tindak pidana yang \ndiancam dengan pidana penjara paling \nsingkat \n5 (\nlima\n) \ntahun  atau lebih\n, kecuali 5 (lima) tahun setelah \nselesai me\nnjalani pidana penjara dan \nmengumumkan\n \nsecara jujur dan terbuka kepada publik bahwa yang \nbersangkutan pernah dipidana serta bukan sebagai \npelaku kejahatan berulang\n-\nulang\n;\n \nj.\n \ntidak sedang dicabut hak pilihnya sesuai dengan \nputusan pengadilan yang \ntelah \nmempuny\nai kekuatan \nhukum tetap;\n \n \nk.\n \nberbadan sehat; \n \nl.\n \ntidak pernah sebagai Kepala Desa selama 3 (tiga) kali \nmasa jabatan; dan \n \nm.\n \nsyarat \nl\nain yang di\natur dalam Peraturan Daerah.\n \n \nPasal \n3\n4\n \n(1)\n \nKepala Desa dipilih langsung oleh \npenduduk \nDesa\n.\n \n(2)\n \nPemilihan \nKepala Desa\n \nbersifat l\nangsung, umum, \nbebas, rahasia, jujur\n,\n \ndan adil.\n \n(3) Pemilihan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n21 \n-\n \n \n(3)\n \nPemilihan \nKepala Desa\n \ndilaksanakan melalui tahap \npencalonan\n, pemungutan suara,  dan penetapan\n.\n \n(4)\n \nDalam melaksanakan pemilihan Kepala Desa \nsebagaimana dimaksud pada ayat (2), dibentuk \npanitia pemilihan Kepala De\nsa.\n \n(5)\n \nPanitia pemilihan sebagaimana dimaksud pada \n         \nayat (\n4\n) \nber\ntugas mengadakan penjaringan dan \npenyaringan bakal calon berdasarkan persyaratan \nyang ditentukan, melaksanakan pemungutan suara, \nmenetapkan calon \nKepala Desa\n \nterpilih, dan \nmelaporkan pela\nksanaan pemilihan \nKepala Desa\n.\n \n(6)\n \nBiaya pemilihan Kepala Desa dibebankan pada \nAnggaran Pendapatan dan Belanja Daerah \nKabupaten/Kota.\n \n \nPasal 35\n \nPenduduk Desa sebagaimana dimaksud dalam Pasal 34 \nayat (1) yang pada hari pemungutan suara pemilihan \nKepala Desa sud\nah berumur 17 (tujuh belas) tahun atau \nsudah/pernah menikah ditetapkan sebagai pemilih. \n \n \n \n \nPasal \n3\n6\n \n(1)\n \nBakal calon Kepala Desa yang telah memenuhi \npersyaratan sebagaimana dimaksud dalam Pasal 33 \nditetapkan sebagai calon Kepala Desa oleh panitia \npemilihan Kep\nala Desa.\n \n(2)\n \nCalon \nKepala Desa\n \nyang telah ditetapkan sebagaimana \ndimaksud pada ayat (1) diumumkan kepada \nmasyarakat Desa di tempat umum sesuai dengan \nkondisi sosial budaya masyarakat Desa.\n \n(3)\n \nCalon\n \nKepala Desa\n \ndapat melakukan kampanye sesuai \ndengan kondisi sosia\nl budaya masyarakat \nDesa \ndan\n \nketentuan\n \nperaturan perundang\n-\nundangan.\n \n \n \n \n \n \nPasal 37 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n22 \n-\n \n \n \n \n \n \nPasal \n3\n7\n \n(1)\n \nCalon \nKepala Desa\n \nyang dinyatakan terpilih adalah \ncalon yang \nmemperoleh \nsuara terbanyak.\n \n(2)\n \nPanitia pemilihan Kepala Desa menetapkan calon \nKepala Desa terpilih.\n \n(3)\n \nPanitia \np\ne\nmilihan \nKepala Desa\n \nmenyampaikan nama \ncalon Kepala Desa terpilih kepada Badan \nPermusyawaratan Desa paling lama 7 (tujuh) hari \nsetelah penetapan calon Kepala Desa terpilih \nsebagaimana dimaksud pada ayat (2).\n \n(4)\n \nBadan Permusyawaratan Desa paling lama 7 (tujuh) \nhari setelah menerima laporan panitia pemilihan \nmenyampaikan nama calon Kepala Desa terpilih \nkepada Bupati/Walikota.\n \n(5)\n \nBupati/\nWalikota\n \nmen\ngesahkan calon Kepala Desa\n \nterpilih \nsebagaimana dimaksud pada ayat (3)\n \nmenjadi \nKepala Desa \npaling lama 30 (tiga puluh) h\nari sejak \ntanggal diterimanya penyampaian hasil pemilihan dari\n \npanitia pemilihan Kepala Desa dalam bentuk \nkeputusan Bupati/Walikota.\n \n(6)\n \nDalam hal terjadi perselisihan hasil pemilihan Kepala \nDesa, Bupati/Walikota wajib menyelesaikan \nperselisihan dalam jangka w\naktu sebagaimana \ndimaksud pada ayat (5). \n \n \nPasal \n3\n8\n \n(1)\n \nCalon Kepala Desa terpilih dilantik oleh \nBupati/Walikota atau pejabat yang ditunjuk paling \nlama 30 (tiga puluh) hari setelah penerbitan \nkeputusan Bupati/Walikota. \n \n(2)\n \nSebelum memangku jabatannya, Kepala Desa\n \nterpilih \nbersumpah/berjanji.\n \n \n \n \n \n(3) Sumpah \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n23 \n-\n \n \n(3)\n \nSumpah/janji sebagaimana dimaksud pada ayat (\n2\n) \nsebagai berikut:\n \n \n&#x0000;ë€&#x0000;âœ€&#x0000;ä €&#x0000;å€€&#x0000;ä°€&#x0000;Ì€&#x0000;â€&#x0000;ä¼€&#x0000;ä¼€&#x0000;ä€&#x0000;ä¬€\n/\nTuhan, saya bersumpah/berjanji bahwa \nsaya akan memenuhi kewajiban saya selaku Kepala \nDesa dengan sebaik\n-\nbaiknya, sejujur\n-\njujurnya, dan \nseadil\n-\na\ndilnya; bahwa saya akan selalu taat dalam \nmengamalkan dan mempertahankan Pancasila \nsebagai dasar negara; dan bahwa saya akan \nmenegakkan kehidupan demokrasi dan Undang\n-\nUndang Dasar Negara Republik\n \nIndonesia Tahun 1945 \nserta melaksanakan segala peraturan per\nundang\n-\nundangan dengan selurus\n-\nlurusnya yang berlaku bagi \nDesa, daerah, dan Negara Kesatuan Republik \n&#x0000;â°€&#x0000;å„€&#x0000;äœ€&#x0000;åˆ€&#x0000;å„€&#x0000;ä €&#x0000;å˜€&#x0000;ä°€&#x0000;ä€&#x0000;ë”€&#x0000;á„€\n \n \nPasal \n3\n9\n \n(1)\n \nKepala Desa memegang jabatan selama 6 (enam) \ntahun \nterhitung sejak tanggal pelantikan\n.\n \n(2)\n \nKepala Desa sebagaimana dimaksud pada ayat (1)\n \ndapat menjabat paling banyak 3 (tiga) kali masa \njabatan secara berturut\n-\nturut atau tidak secara \nberturut\n-\nturut.  \n \n \nBagian Keempat\n \nPemberhentian Kepala Desa\n \n \nPasal 40\n \n(1)\n \nKepala Desa berhenti karena:\n \na.\n \nmeninggal dunia;\n \nb.\n \np\nermintaan sendiri;\n \natau\n \nc.\n \ndiberhentikan.\n \n(2)\n \nKep\nala Desa diberhentikan sebagaimana dimaksud \npada ayat (1) huruf \nc\n \nkarena:\n \na.\n \nberakhir masa jabatannya\n;\n \nb.\n \ntidak dapat melaksanakan tugas secara \nberkelanjutan atau berhalangan tetap secara \nberturut\n-\nturut selama 6 (enam) bulan;\n \n \nc. tidak \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n24 \n-\n \n \nc.\n \ntidak lagi memenuhi syarat sebagai\n \ncalon Kepala \nDesa; atau\n \nd.\n \nmelanggar larangan \nsebagai\n \nKepala Desa\n.\n \n(3)\n \nPemberhentian Kepala Desa sebagaimana dimaksud \npada ayat (1) ditetapkan oleh Bupati/Walikota.\n \n(4)\n \nKetentuan lebih lanjut mengenai pemberhentian Kepala \nDesa sebagaimana dimaksud pada ayat (1) diat\nur dalam \nPeraturan Pemerintah\n.\n \nPasal 41\n \nKepala Desa diberhentikan sementara oleh \nBupati\n/\nWalikota setelah \ndinyatakan \nsebagai terdakwa \nyang diancam dengan pidana \npenjara \npaling \nsingkat\n \n          \n5 (lima) tahun\n \nberdasarkan register perkara di pengadilan. \n \n \nPa\nsal 42\n \nKepala Desa diberhentikan sementara oleh \nBupati\n/\nWalikota\n \nse\ntelah ditetapkan sebagai tersangka \ndalam \ntindak \npidana korupsi, terorisme, makar, dan/atau \ntindak pidana terhadap keamanan negara.\n \n \nPasal 43\n \nKepala Desa \nyang \ndiberhentikan \nsementara sebagaim\nana \ndimaksud\n \n \ndalam Pasal 41 dan Pasal 42 diberhentikan \noleh Bupati\n/\nWalikota setelah\n \ndinyatakan sebagai \nterpidana \nberdasarkan putusan pengadilan yang telah \nmempunyai\n \nkekuatan hukum tetap.\n \n \nPasal \n4\n4\n \n(1)\n \nKepala Desa yang diberhentikan sementara \nsebagaimana dima\nksud dalam Pasal 41 dan Pasal 42 \nsetelah melalui proses peradilan ternyata terbukti \ntidak bersalah berdasarkan putusan pengadilan yang \ntelah mempunyai kekuatan hukum tetap, paling lama \n30 (tiga puluh) hari sejak penetapan putusan \npengadilan diterima oleh K\nepala Desa, \nBupati/Walikota merehabilitasi dan mengaktifkan \nkembali Kepala Desa yang bersangkutan sebagai \nKepala Desa sampai dengan akhir masa jabatannya. \n \n(2) Apabila \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n25 \n-\n \n \n(2)\n \nApabila Kepala Desa yang diberhentikan sementara \nsebagaimana dimaksud pada ayat (1) telah berakhir \nm\nasa jabatannya, Bupati/Walikota harus \nmerehabilitasi nama baik Kepala Desa yang \nbersangkutan. \n \nPasal 45\n \nDalam hal Kepala Desa diberhentikan sementara \nsebagaimana dimaksud dalam Pasal 41 dan Pasal 42, \nsekretaris Desa melaksanakan tugas dan kewajiban \nKepala \nDesa sampai dengan adanya putusan pengadilan \nyang telah mempunyai kekuatan hukum tetap.\n \n \nPasal \n4\n6\n \n(1)\n \nDalam hal sisa masa jabatan Kepala Desa yang \ndiberhentikan sebagaimana dimaksud dalam Pasal 43 \ntidak lebih dari 1 (satu) tahun, Bupati/Walikota \nmengangkat peg\nawai negeri sipil dari Pemerintah \nDaerah Kabupaten/Kota sebagai penjabat Kepala \nDesa sampai dengan terpilihnya Kepala Desa.\n \n(2)\n \nPenjabat Kepala Desa melaksanakan tugas, \nwewenang, kewajiban, dan hak Kepala Desa \nsebagaimana dimaksud dalam Pasal 26.\n \n \nPasal \n4\n7\n \n(1)\n \nDal\nam hal sisa masa jabatan Kepala Desa yang \ndiberhentikan sebagaimana dimaksud dalam Pasal 43 \nlebih dari 1 (satu) tahun, Bupati/Walikota \nmengangkat pegawai negeri sipil dari Pemerintah \nDaerah Kabupaten/Kota sebagai penjabat Kepala \nDesa.\n \n(2)\n \nPenjabat Kepala Desa \nsebagaimana dimaksud pada \nayat (1) melaksanakan tugas, wewenang, kewajiban, \ndan hak Kepala Desa sebagaimana dimaksud dalam \nPasal 26 sampai dengan ditetapkannya Kepala Desa.\n \n(3)\n \nKepala Desa sebagaimana dimaksud pada ayat (2) \ndipilih melalui Musyawarah Desa yan\ng memenuhi \npersyaratan sebagaimana dimaksud dalam Pasal 33.\n \n(4) Musyawarah \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n26 \n-\n \n \n(4)\n \nMusyawarah Desa sebagaimana dimaksud pada \n          \nayat (3) dilaksanakan paling lama 6 (enam) bulan \nsejak Kepala Desa diberhentikan. \n \n(5)\n \nKepala Desa yang dipilih melalui Musyawarah Desa \nsebagaimana \ndimaksud pada ayat (3) melaksanakan \ntugas Kepala Desa sampai habis sisa masa jabatan \nKepala Desa yang diberhentikan.\n \n(6)\n \nKetentuan lebih lanjut mengenai Musyawarah Desa \nsebagaimana dimaksud pada ayat (3) diatur dalam \nPeraturan Pemerintah.\n \n \nBagian Kelima\n \nPerang\nkat Desa\n \n \nPasal \n4\n8\n \nPerangkat Desa terdiri atas:\n \na.\n \nsekretariat Desa;\n \nb.\n \npelaksana kewilayahan; dan\n \nc.\n \npelaksana teknis.\n \n \nPasal \n4\n9\n \n(1)\n \nPerangkat Desa \nsebagaimana dimaksud dalam\n         \n \nPasal 48 \nbertugas membantu \nKepala Desa\n \ndalam \nmelaksanakan tugas dan wewenangnya.\n \n(2)\n \nPer\nangkat Desa\n \nsebagaimana dimaksud \npada\n \nayat (\n1\n) \ndi\nangkat \noleh \nKepala Desa setelah dikonsultasikan \ndengan Camat atas nama Bupati/Walikota\n.\n \n(3)\n \nDalam melaksanakan tugas dan wewenangnya, \nperangkat Desa sebagaimana dimaksud pada ayat (1) \nbertanggung jawab kepada \nKe\npala Desa. \n \n \nPasal 50\n \n(1)\n \nPerangkat Desa sebagaimana dimaksud dalam\n          \n \nPasal 48 diangkat dari warga Desa yang memenuhi \npersyaratan:\n \na. berpendidikan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n27 \n-\n \n \na.\n \nberpendidikan paling rendah sekolah menengah \numum atau yang sederajat;\n \nb.\n \nberusia 20 (dua puluh) tahun sampai dengan\n       \n  \n \n42 (empat puluh dua) tahun;\n \nc.\n \nterdaftar sebagai penduduk Desa dan bertempat \ntinggal di Desa paling kurang 1 (satu) tahun \nsebelum pendaftaran; dan\n \nd.\n \nsyarat lain yang ditentukan dalam Peraturan \nDaerah Kabupaten/Kota.\n \n(2)\n \nKetentuan lebih lanjut mengenai perangkat \nDesa \nsebagaimana dimaksud dalam Pasal 48, Pasal 49, dan \nPasal 50 ayat (1) diatur dalam Peraturan Daerah \nKabupaten/Kota berdasarkan Peraturan Pemerintah.\n \n \nPasal 51\n \nPerangkat Desa \ndilarang\n:\n \na.\n \nmerugikan kepentingan umum;\n \nb.\n \nmembuat keputusan yang \nm\ne\nng\nuntun\ngk\nan dir\ni \nsendiri, anggota keluarga\n, pihak lain, \ndan/atau \ngolongan tertentu;\n \nc.\n \nmenyalahgunakan wewenang, tugas, hak\n,\n \ndan/atau \nkewajibannya; \n \nd.\n \nmelakukan tindakan diskrimina\ntif\n \nterhadap warga \ndan/\natau golongan masyarakat tertentu;\n \ne.\n \nmelakukan tindakan meresahkan sekelomp\nok \nmasyarakat Desa;\n \nf.\n \nmelakukan kolusi, korupsi, dan nepotisme, menerima \nuang, barang\n,\n \ndan/atau jasa dari pihak lain yang \ndapat memengaruhi keputusan atau tindakan yang \nakan dilakukannya;\n \ng.\n \nmenjadi pengurus\n \npartai politik\n; \n \nh.\n \nmenjadi anggota dan/atau pengurus or\nganisasi \nterlarang;\n \n \n \ni. merangkap \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n28 \n-\n \n \ni.\n \nmerangkap jabatan sebagai ketua dan/atau anggota \nBadan Permusyawaratan Desa, anggota Dewan \nPerwakilan Rakyat Republik Indonesia, Dewan \nPerwakilan Daerah Republik Indonesia, Dewan \nPerwakilan Rakyat Daerah Provinsi atau Dewan \nPerwakila\nn Rakyat Daerah Kabupaten/Kota, dan \njabatan lain yang ditentukan dalam peraturan \nperundangan\n-\nundangan;\n \nj.\n \nikut serta dan/atau terlibat dalam kampanye\n \npemilihan umum\n \ndan/atau pemilihan \nkepala daerah;\n \n \nk.\n \nmelanggar sumpah/janji jabatan; dan\n \nl.\n \nmeninggalkan tugas sela\nma \n60\n \n(\nenam puluh\n) \nhari\n \nkerja \nberturut\n-\nturut tanpa alasan yang jelas\n \ndan tidak \ndapat dipertanggungjawabkan.\n \n \n \n \n \nPasal 52\n \n(1)\n \nPerangkat Desa yang melanggar larangan \nsebagaimana dimaksud dalam Pasal 51 dikenai sanksi \nadministratif berupa teguran lisan dan/atau t\neguran \ntertulis.\n \n(2)\n \nDalam hal sanksi administratif sebagaimana \ndimaksud pada ayat (1) tidak dilaksanakan, dilakukan \ntindakan pemberhentian sementara dan dapat \ndilanjutkan dengan pemberhentian.\n \n \n \nPasal \n5\n3\n \n(1)\n \nPerangkat\n \nDesa berhenti karena:\n \na.\n \nmeninggal dunia;\n \nb.\n \np\nermin\ntaan sendiri;\n \natau\n \nc.\n \ndiberhentikan.\n \n(2)\n \nPerangkat\n \nDesa \nyang \ndiberhentikan sebagaimana \ndimaksud pada ayat (1) \nhuruf \nc\n \nkarena:\n \na.\n \nusia telah genap 60 (enam puluh) tahun;\n \nb.\n \nberhalangan tetap;\n \n \n \nc. tidak \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n29 \n-\n \n \nc.\n \ntidak lagi memenuhi syarat sebagai perangkat \nDesa; atau \n \nd.\n \nmelanggar larangan\n \nsebagai\n \nperangkat\n \nDesa.\n \n(3)\n \nPemberhentian perangkat Desa sebagaimana \ndimaksud pada ayat (1) ditetapkan oleh Kepala Desa \nsetelah dikonsultasikan dengan  Camat atas nama \nBupati/Walikota.\n \n \n(4)\n \nKetentuan lebih lanjut mengenai pemberhentian \nperangkat Desa sebagaimana \ndimaksud pada ayat (3) \ndiatur dalam Peraturan Pemerintah.\n \n \nBagian Keenam\n \nMusyawarah Desa \n \n \nPasal \n5\n4\n \n(1)\n \nMusyawarah Desa merupakan forum \npermusyawaratan yang diikuti oleh Badan \nPermusyawaratan Desa, Pemerintah Desa, dan unsur \nmasyarakat  Desa untuk memusyawarah\nkan hal yang \nbersifat strategis dalam penyelenggaraan \nPemerintahan Desa.\n \n(2)\n \nHal yang bersifat strategis sebagaimana dimaksud \npada ayat (1) meliputi:\n \na.\n \npenataan Desa;\n \nb.\n \nperencanaan Desa;\n \nc.\n \nkerja sama Desa;\n \nd.\n \nrencana investasi yang masuk ke Desa;\n \ne.\n \npembentukan BUM Desa; \n \nf.\n \n \npenambahan dan pelepasan \nA\nset Desa; dan\n \ng.\n \nkejadian luar biasa.\n \n(3)\n \nMusyawarah \nDesa sebagaimana dimaksud pada\n         \n \nayat (1)\n \ndilaksanakan\n \npaling kurang\n \nsekali dalam \n            \n1 (satu) tahun\n.\n \n \n(4)\n \nMusyawarah\n \nDesa sebagaimana dimaksud pada\n         \n \nayat (1) dib\niayai dari Anggaran Pendapatan dan \nBelanja Desa.\n \nBagian \n.\n \n. .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n30 \n-\n \n \nBagian Ketujuh\n \nBadan Permusyawaratan Desa \n \n \nPasal  \n5\n5\n \nBadan Permusyawaratan Desa \n \nmempunyai \nfungsi\n:\n \na.\n \nmembahas dan menyepakati Rancangan Peraturan \nDesa bersama Kepala Desa;\n \nb.\n \nmenampung dan menyalurkan aspirasi m\nasyarakat \nDesa; dan\n \nc.\n \nmelakukan pengawasan kinerja Kepala Desa.\n \nPasal \n5\n6\n \n(1)\n \nAnggota Badan Permusyawaratan Desa merupakan \nwakil dari penduduk Desa berdasarkan keterwakilan \nwilayah yang pengisiannya dilakukan secara \ndemokratis.\n \n(2)\n \nMasa \nke\nanggota\nan Badan Permusyawara\ntan Desa\n \nselama\n \n6\n \n(\nenam\n) tahun\n \nterhitung sejak tanggal\n \npengucapan sumpah/janji.\n \n(3)\n \nAnggota Badan Permusyawaratan Desa sebagaimana \ndimaksud pada ayat (1) dapat dipilih untuk masa \nkeanggotaan paling banyak \n3 (tiga) kali\n \nsecara \nberturut\n-\nturut atau tidak secara b\nerturut\n-\nturut.  \n \n \nPasal \n5\n7\n \nPersyaratan \nc\nalon \na\nnggota \nBadan Permusyawaratan Desa \nadalah\n:\n \na.\n \nberta\nk\nwa kepada Tuhan Yang Maha Esa;\n \nb.\n \nmemegang teguh dan mengamalkan Pancasila, \nmelaksanakan Undang\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945, serta \nmempertahank\nan dan memelihara keutuhan Negara \nKesatuan Republik Indonesia dan Bhinneka Tunggal \nIka;\n \nc.\n \nberusia paling rendah 2\n0\n \n(dua puluh) tahun\n \natau \nsudah/\npernah menikah\n;\n \nd. berpendidikan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n31 \n-\n \n \nd.\n \nberpendidikan paling rendah tamat sekolah menengah \npertama atau sederajat;\n \ne.  \n \nbukan sebagai per\nangkat Pemerintah Desa;\n \nf.\n \nbersedia dicalonkan menjadi anggota\n \nBadan \nPermusyawaratan Desa\n; dan\n \ng.\n \nwakil penduduk Desa yang dipilih secara demokratis.\n \n \nPasal  \n5\n8\n \n(1)\n \nJumlah anggota \nBadan Permusyawaratan Desa\n \nditetapkan dengan jumlah gasal, paling \n                    \n  \nsedikit 5 (lima) orang dan paling banyak \n                           \n9\n \n(se\nmbilan\n) orang\n,\n \ndengan memperhatikan wilayah, \nperempuan, penduduk, dan kemampuan Keuangan \nDesa.\n \n(2)\n \nPeresmian anggota \nBadan Permusyawaratan Desa\n \nsebagaimana dimaksud \npada\n \nayat (1) diteta\npkan \ndengan \nk\neputusan \nBupati\n/\nWalikota\n.\n \n(3)\n \nAnggota \nBadan Permusyawaratan Desa \nsebelum \nmemangku jabatannya \nber\nsumpah/\nber\njanji secara \nbersama\n-\nsama di\n \nhadapan masyarakat dan dipandu \noleh \nBupati\n/ \nWalikota\n \natau pejabat yang ditunjuk.\n \n(4)\n \nSusunan kata sumpah/janji anggo\nta \nBadan \nPermusyawaratan Desa sebagai berikut\n:\n \n \n&#x0000;ë”€&#x0000;âœ€&#x0000;ä €&#x0000;å€€&#x0000;ä°€&#x0000;Ì€&#x0000;â€&#x0000;ä¼€&#x0000;ä¼€&#x0000;ä€&#x0000;ä¬€\n/\nTuhan, saya bersumpah/berjanji bahwa \nsaya akan memenuhi kewajiban saya selaku anggota \nBadan Permusyawaratan Desa\n \ndengan sebaik\n-\nbaiknya, sejujur\n-\njujurnya, dan seadil\n-\nadilnya;\n \nb\nahwa \nsaya akan selalu\n \ntaat dalam mengamalkan \ndan \nmempertahankan\n \nP\nancasila sebagai dasar negara, dan \nbahwa saya akan menegakkan kehidupan demokrasi \ndan Undang\n-\nU\nndang Dasar\n \nNegara Republik Indonesia \nTahun\n \n1945 serta melaksanakan segala peraturan \nperundang\n-\nundangan dengan selurus\n-\nlurusnya yang \nberlaku bagi Desa, daerah, dan Negara Kesatuan \n&#x0000;ã”€&#x0000;ä €&#x0000;åŒ€&#x0000;å €&#x0000;ä”€&#x0000;ä¼€&#x0000;ä°€&#x0000;ä¸€&#x0000;Ì€&#x0000;â°€&#x0000;å„€&#x0000;äœ€&#x0000;åˆ€&#x0000;å„€&#x0000;ä €&#x0000;å˜€&#x0000;ä°€&#x0000;ä€&#x0000;ë”€\n.\n \n \n \n \nPasal 59 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n32 \n-\n \n \nPasal \n5\n9\n \n(1)\n \nPimpinan \nBadan Permusyawaratan Desa\n \nterdiri \natas\n \n \n1 (\nsatu\n)\n \norang \nk\netua, \n1 (\nsatu\n)\n \norang \nw\nakil \nk\netua, dan \n \n1 (\nsatu\n)\n \norang \ns\nekretaris\n.\n \n(2)\n \nPimpinan \nBadan Permusyawarat\nan Desa\n \nsebagaimana \ndimaksud pada ayat (1) dipilih dari dan oleh anggota \nBadan Permusyawaratan Desa \nsecara langsung dalam \nr\napat \nBadan Permusyawaratan Desa\n \nyang diadakan \nsecara khusus\n.\n \n(3)\n \nRapat pemilihan \np\nimpinan \nBadan Permusyawaratan \nDesa\n \nuntuk pertama kali d\nipimpin oleh anggota tertua \ndan dibantu oleh anggota termuda.\n \n \nPasal \n60\n \nBadan Permusyawaratan Desa\n \nmenyusun \nperaturan \ntata \ntertib\n \nBadan Permusyawaratan Desa\n.\n \n \nPasal\n \n61\n \n \nBadan Permusyawaratan Desa\n \nberhak:\n \na.\n \nmengawasi dan \nmeminta keterangan \ntentang \npenyelengga\nraan Pemerintahan Desa \nkepada \nPemerintah Desa\n;\n \nb.\n \nmenyatakan pendapat atas penyelenggaraan \nPemerintahan Desa, \npelaksanaan Pembangunan Desa, \npembinaan kemasyarakatan Desa, dan \np\nemberdayaan \nm\nasyarakat Desa\n; dan\n \nc.\n \nmendapatkan biaya operasional pelaksanaan tugas \nda\nn fungsinya dari Anggaran Pendapatan dan Belanja \nDesa.\n \n \nPasal 62\n \nAnggota \nBadan Permusyawaratan Desa\n \nberhak:\n \na.\n \nmengajukan \nusul \nrancangan Peraturan Desa;\n \nb.\n \nmengajukan pertanyaan;\n \nc.\n \nmenyampaikan usul dan\n/atau\n \npendapat;\n \nd. memilih \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n33 \n-\n \n \nd.\n \nmemilih dan dipilih; \ndan\n \ne.\n \nmendapat tunjangan d\nari Anggaran Pendapatan dan \nBelanja Desa.\n \n \n \nPasal \n6\n3\n \nAnggota \nBadan Permusyawaratan Desa\n \nwajib:\n \na.\n \nmemegang teguh dan mengamalkan Pancasila, \nmelaksanakan Undang\n-\nUndang Dasar Negara \nRepublik Indonesia Tahun 1945, serta \nmempertahankan dan memelihara keutuhan Neg\nara \nKesatuan Republik Indonesia\n \ndan Bhinneka Tunggal \nIka\n;\n \nb.\n \nmelaksanakan kehidupan demokrasi\n \nyang berkeadilan \ngender\n \ndalam penyelenggaraan Pemerintahan Desa;\n \nc.\n \nmenyerap, menampung, menghimpun, dan \nmenindaklanjuti aspirasi masyarakat Desa;\n \nd.\n \nmendahulukan kepentin\ngan umum di atas kepentingan \npribadi, kelompok, dan\n/atau\n \ngolongan\n;\n \ne.\n \nmenghormati nilai sosial budaya dan adat istiadat \nmasyarakat \nDesa\n; dan\n \nf.\n \nmenjaga norma dan etika dalam hubungan kerja \ndengan lembaga kemasyarakatan\n \nDesa\n.\n \n \nPasal \n6\n4\n \nAnggota \nBadan Permusyawarat\nan Desa\n \ndilarang:\n \na.\n \nmerugikan kepentingan umum, meresahkan \nsekelompok masyarakat Desa, dan \nmendiskriminasikan warga atau golongan masyarakat \nDesa;\n \nb.\n \nmelakukan korupsi, kolusi, \ndan \nnepotisme\n,\n \nmenerima \nuang, barang\n,\n \ndan/atau jasa dari pihak lain yang \ndapat memen\ngaruhi keputusan atau tindakan yang \nakan dilakukannya;\n \nc.\n \nmenyalahgunakan wewenang; \n \nd.\n \nmelanggar sumpah/janji jabatan\n;\n \ne. merangkap \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n34 \n-\n \n \ne.\n \nmerangkap jabatan sebagai \nKepala Desa\n \ndan \np\nerangkat Desa; \n \nf.\n \nmerangkap sebagai \na\nnggota Dewan Perwakilan Rakyat\n \nRepublik Indonesia\n, Dewan Perwak\nilan Daerah\n \nRepublik \nIndonesia\n, \nDewan Perwakilan Rakyat Daerah Provinsi\n \natau \nDewan Perwakilan Rakyat Daerah\n \nKabupaten/Kota,\n \ndan jabatan lain yang ditentukan dalam peraturan \nperundangan\n-\nundangan\n;\n \n \ng.\n \nsebagai pelaksana proyek Desa\n;\n \n \nh.\n \nmenjadi pengurus partai poli\ntik;\n \ndan/atau\n \ni.\n \nmenjadi anggota dan/atau pengurus organisasi \nterlarang.\n \n \nPasal  \n6\n5\n \n(1)\n \nMekanisme \nmusyawarah Badan Permusyawaratan \nDesa sebagai berikut\n:\n \na.\n \nmusyawarah Badan Permusyawaratan Desa\n \ndipimpin oleh \np\nimpinan \nBadan Permusyawaratan \nDesa;\n \nb.\n \nmusyawarah Badan Perm\nusyawaratan Desa\n \ndinyatakan sah apabila dihadiri oleh \npaling sedikit \n2\n/\n3\n \n(dua pertiga) dari jumlah anggota \nBadan \nPermusyawaratan Desa;\n \nc.\n \npengambilan \nkeputusan\n \ndilakukan dengan cara \nmusyawarah guna mencapai mufakat;\n \nd.\n \napabila musyawarah mufakat tidak tercapai, \npengambilan  keputusan dilakukan dengan cara \npemungutan suara;\n \ne.\n \npemungutan suara sebagaimana dimaksud dalam \nhuruf d dinyatakan sah apabila disetujui oleh \npaling sedikit\n \n½ (satu perdua) ditambah 1 (satu) \ndari jumlah anggota \nBadan Permusyawaratan \nDesa\n \nyang ha\ndir\n; dan\n \nf.\n \n \nh\nasil \nmusyawarah Badan Permusyawaratan \nDesa\n \nditetapkan dengan \nk\neputusan \nBadan \nPermusyawaratan Desa\n \ndan dil\nampiri \nnotulen \nmusyawarah\n \nyang dibuat\n \noleh\n \nsekretaris \nBadan \nPermusyawaratan Desa.\n \n(2) Ketentuan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n35 \n-\n \n \n(2)\n \nKetentuan lebih lanjut mengenai Badan \nPermusyawaratan Des\na diatur dalam Peraturan \nDaerah Kabupaten/Kota.\n \n \n \nBagian \nKedelapan\n \nPenghasilan Pemerintah Desa \n \n \n \n \nPasal \n6\n6\n \n(1)\n \nKepala Desa dan perangkat Desa memperoleh \npenghasilan tetap setiap bulan.\n \n(2)\n \nPenghasilan tetap Kepala Desa dan perangkat Desa \nse\nbagaimana dimaksud pada\n \nayat (1) \nbersumber dari \ndana perimbangan dalam Anggaran Pendapatan dan \nBelanja Negara yang diterima oleh Kabupaten/Kota dan \nditetapkan dalam Anggaran Pendapatan dan Belanja \nDaerah Kabupaten/Kota. \n \n(3)\n \nSelain penghasilan tetap sebagaimana dimaksud pada \nayat (1\n), Kepala Desa dan perangkat Desa \nmenerima \ntunjangan\n \nyang bersumber dari Anggaran Pendapatan \ndan Belanja Desa.\n \n(4)\n \nSelain penghasilan tetap sebagaimana dimaksud pada \nayat (1), Kepala Desa dan perangkat Desa memperoleh \njaminan kesehatan dan dapat memperoleh \npen\nerimaan lainnya yang sah.\n \n(5)\n \nKetentuan lebih lanjut mengenai besaran penghasilan \ntetap sebagaimana dimaksud pada ayat (1) dan \ntunjangan sebagaimana dimaksud pada ayat (3) serta \npenerimaan lainnya yang sah sebagaimana dimaksud \npada ayat (4) diatur dalam Peratu\nran Pemerintah.\n \n \n \n \n \n \n \n \n \n \n \nBAB VI \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n36 \n-\n \n \nB\nAB V\nI\n \nHAK DAN KEWAJIBAN\n \nDESA DAN \nMASYARAKAT\n \nDESA \n \n \nPasal \n6\n7\n \n(1)\n \nDesa \nber\nhak:\n \na.\n \nmengatur dan mengurus kepentingan masyarakat \nberdasarkan hak asal usul, adat istiadat\n,\n \ndan nilai \nsosial budaya masyarakat\n \nDesa\n;\n \nb.\n \nmenetapkan \ndan mengelola \nke\nlembagaan \nDesa;\n \ndan\n \nc.\n \nmendapatkan sumber pendapatan.\n \n(2)\n \nDesa \nberkewajiban\n:\n \na.\n \nm\nelindungi\n \ndan \nmenjaga persatuan, kesatuan\n,\n \nserta\n \nkerukunan masyarakat \nDesa dalam rangka \nkerukunan nasional dan \nkeutuhan Negara \nKesatuan Republik Indonesia;\n \nb.\n \nmeningkatkan kualitas kehidup\nan masyarakat\n \nDesa\n;\n \nc.\n \nmengembangkan kehidupan demokrasi;\n \nd.\n \nmengembangkan pemberdayaan masyarakat\n \nDesa\n; \nda\nn\n \ne.\n \nmemberi\nkan\n \ndan meningkatkan pelayanan \nkepada\n \nmasyarakat\n \nDesa\n.\n \n \nPasal \n6\n8\n \n(1)\n \nMasyarakat  \nDesa\n \nberhak\n:\n \na.\n \nmeminta dan \nmendapatkan \ninformasi \ndari\n \nP\nemerintah \nDesa s\nerta\n \nmengawasi kegiatan \npenyelenggaraan Pemerintahan Desa, \npelaksanaan \nPembangunan Desa, pembinaan kemasyarakatan \nDesa, dan pemberdayaan masyarakat Desa\n;\n \nb.\n \nmemperoleh pelayanan yang sama dan adil;\n \n \n \n \nc. menyampaikan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n37 \n-\n \n \nc.\n \nmenyampaikan \naspirasi, \nsaran\n,\n \ndan pendapat\n \nlisan \natau ter\ntulis\n \nsecara bertanggung jawab tentang \nkegiatan \npenyelenggaraan Pemerintahan Desa, \npelaksanaan Pembangunan Desa, pembinaan \nkemasyarakatan Desa, dan pemberdayaan \nmasyarakat Desa\n;\n \nd.\n \nmemilih, dipilih\n,\n \ndan/atau ditetapkan menjadi\n:\n \n1.\n \nKepala Desa;\n \n2.\n \nperangkat Desa;\n \n3.\n \nan\nggota \nBadan Permusyawaratan Desa\n; atau\n \n4.\n \nanggota \nlembaga kemasyarakatan\n \nDesa.\n \ne.\n \nmendapatkan\n \npengayoman dan\n \npe\nr\nlindungan dari \ngangguan\n \nketenteraman dan ketertiban\n \ndi Desa\n.\n \n(2)\n \nMasyarakat \nDesa ber\nkewajiban:\n \na.\n \nmembangun diri dan \nmemelihara \nlingkungan\n \nDesa\n;\n \nb.\n \nmendorong te\nrciptanya kegiatan \npenyelenggaraan \nPemerintahan Desa, \npelaksanaan Pembangunan \nDesa, pembinaan kemasyarakatan Desa, dan \npemberdayaan masyarakat Desa\n \nyang baik;\n \nc.\n \nmendorong terciptanya situasi yang aman\n, \nnyaman, dan tenteram di Desa\n;\n \nd.\n \nmemelihara dan mengembangk\nan nilai \npermusyawaratan, permufakatan, kekeluargaan, \ndan \nke\ngotongroyong\nan di Desa\n; dan\n \ne.\n \nberpartisipasi dalam berbagai kegiatan\n \ndi Desa\n.\n \n \nBAB VII\n \nPERATURAN DESA\n \n \n \nPasal\n \n6\n9\n \n(1)\n \nJenis p\neraturan \ndi Desa\n \nterdiri atas\n \nP\neraturan \nDesa\n, \nperaturan bersama \nKepala Desa\n, \nd\nan \nperaturan \nKepala Desa.\n \n \n(2) Peraturan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n38 \n-\n \n \n(2)\n \nPeraturan sebagaimana dimaksud \npada ayat (1) \ndilarang\n \nbertentangan dengan kepentingan umum \ndan/atau \nketentuan \nperaturan perundang\n-\nundangan \nyang lebih tinggi.\n \n(3)\n \nPeraturan Desa ditetapkan oleh Kepala Desa setelah \ndibahas dan disepak\nati bersama Badan \nPermusyawaratan Desa.\n \n(4)\n \nRancangan \nP\neraturan \nDesa\n \ntentang \nAnggaran \nPendapatan dan Belanja Desa\n,\n \npungutan,\n \ntata ruang\n,\n \ndan organisasi \nPemerintah Desa \nharus mendapatkan \nevaluasi dari \nBupati\n/\nW\nalikota sebelum ditetapkan \nmenjadi \nP\neraturan \nDesa.\n \n(5)\n \nH\nasil evaluasi sebagaimana dimaksud pada ayat (4) \ndiserahkan oleh Bupati/Walikota paling lama\n         \n \n20 (dua puluh) hari kerja terhitung sejak diterimanya \nrancangan peraturan tersebut oleh Bupati/Walikota.\n \n(6)\n \nDalam hal Bupati/Walikota telah memberikan hasil \nevaluasi sebagaimana dimaksud pada ayat (5), \nKepala Desa wajib memperbaikinya.   \n \n(7)\n \nKepala Desa diberi waktu paling lama 20 (dua puluh) \nhari sejak diterimanya hasil evaluasi untuk \nmelakukan koreksi.\n \n(8)\n \nDalam hal Bupati/Walikota tidak memberikan hasil \nevaluasi d\nalam batas waktu sebagaimana dimaksud \npada ayat (5), Peraturan Desa tersebut berlaku \ndengan sendirinya.\n \n(9)\n \nRancangan Peraturan Desa wajib dikonsultasikan \nkepada masyarakat Desa.\n \n(10)\n \nMasyarakat Desa berhak\n \nmemberikan masukan \nterhadap Rancangan Peraturan Desa.\n \n(11)\n \nPera\nturan \nDesa\n \ndan peraturan \nKepala Desa\n \ndiundangkan\n \ndalam Lembaran Desa\n \ndan Berita Desa \noleh sekretaris Desa.\n \n \n(12)\n \nDalam pelaksanaan Peraturan Desa sebagaimana \ndimaksud pada ayat (1), Kepala Desa menetapkan \nPeraturan Kepala Desa sebagai aturan \npelaksanaannya.\n \n \nPasal 70 \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n39 \n-\n \n \nP\nasal 70\n \n(1)\n \nPeraturan bersama Kepala Desa merupakan \nperaturan yang ditetapkan oleh Kepala Desa dari \n           \n2 (dua) Desa atau lebih yang melakukan kerja sama \nantar\n-\nDesa.\n \n(2)\n \nPeraturan bersama Kepala Desa sebagaimana \ndimaksud pada ayat (1) merupakan perpaduan \nke\npentingan Desa masing\n-\nmasing dalam kerja sama \nantar\n-\nDesa.\n \n \nBAB\n \nVIII\n \nKEUANGAN DESA \nDAN ASET DESA\n \n \nBagian Kesatu\n \nKeuangan Desa\n \n \nPasal 71\n \n(1)\n \nKeuangan Desa adalah semua hak dan kewajiban \nDesa yang dapat dinilai dengan uang serta segala \nsesuatu berupa uang dan bar\nang yang berhubungan \ndengan pelaksanaan hak dan kewajiban Desa. \n \n(2)\n \nHak dan kewajiban sebagaimana  dimaksud pada  \nayat (1) menimbulkan pendapatan, belanja, \npembiayaan, dan pengelolaan Keuangan Desa.\n \n \nPasal 72\n \n(1)\n \nPendapatan \nDesa\n \nsebagaimana dimaksud dalam \nP\nasal\n \n7\n1 ayat (2) \nbersumber dari:\n \na.\n \npendapatan asli \nDesa\n \nterdiri \natas\n \nhasil usaha, \nhasil \naset\n, swadaya dan partisipasi, gotong \nroyong, dan lain\n-\nlain pendapatan asli \nDesa\n;\n \nb.\n \nalokasi Anggaran \nPendapatan dan Belanja \nNegara; \n \nc.\n \nbagian dari hasil pajak daerah dan retribusi \ndaerah \nKabupaten/Kota\n;\n \nd.\n \nalokasi dana Desa yang merupakan bagian dari \ndana perimbangan yang diterima \nKabupaten/Kota;\n \ne. bantuan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n40 \n-\n \n \ne.\n \nbantuan keuangan dari \nAnggaran Pendapatan \ndan Belanja Daerah \n \nProvinsi dan \nAnggaran \nPendapatan dan Belanja Daerah\n \nKabupaten/Kota\n; \n \nf.\n \nhibah dan\n \nsumbangan yang tidak mengikat dari \npihak ketiga\n; dan\n \ng.\n \nlain\n-\nlain pendapatan Desa yang sah.\n \n(2)\n \nAlokasi anggaran sebagaimana dimaksud pada\n         \n \nayat (1) huruf b bersumber dari Belanja Pusat \n \ndengan \nmengefektifkan\n \nprogram yang berbasis Desa \nsecara merata dan \nberkeadilan.\n \n(3)\n \nBagian hasil pajak daerah dan retribusi daerah \nKabupaten/Kota sebagaimana dimaksud pada \n          \nayat (1) huruf c paling sedikit 10% (sepuluh \nperseratus) dari pajak dan retribusi daerah.\n \n(4)\n \nAlokasi dana Desa sebagaimana dimaksud pada\n \n \nayat (1) h\nuruf d paling sedikit 10% (sepuluh \nperseratus) dari dana perimbangan yang diterima \nKabupaten/Kota dalam Anggaran Pendapatan dan \nBelanja Daerah setelah dikurangi Dana Alokasi \nKhusus.\n \n(5)\n \nDalam rangka p\nengelolaan \nK\neuangan \nDesa, Kepala \nDesa \nmelimpahkan\n \nsebagian k\newenangan kepada \nperangkat Desa yang ditunjuk.\n \n(6)\n \nBagi Kabupaten/Kota yang tidak memberikan alokasi \ndana Desa sebagaimana dimaksud pada ayat (4), \nPemerintah dapat melakukan penundaan dan/atau \npemotongan sebesar \nalokasi\n \ndana perimbangan \nsetelah dikurangi Dana \nAlokasi Khusus yang \nseharusnya disalurkan ke Desa.\n \n \nPasal \n7\n3\n \n(1)\n \nAnggaran Pendapatan dan Belanja Desa\n \nterdiri atas \nbagian pendapatan, belanja\n,\n \ndan pembiayaan \nDesa\n.\n \n(2)\n \nRancangan \nAnggaran Pendapatan dan Belanja Desa \ndiajukan oleh Kepala Desa dan dimusyawarahkan \nbe\nrsama\n \nBadan Permusyawaratan Desa\n.\n \n(3) Sesuai \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n41 \n-\n \n \n(3)\n \nSesuai dengan hasil musyawarah sebagaimana \ndimaksud pada ayat (2),  Kepala Desa \nmenetapkan \nAnggaran Pendapatan dan Belanja Desa \nsetiap tahun \ndengan \nP\neraturan \nDesa.\n \nPasal \n7\n4\n \n(1)\n \nBelanja Desa diprioritaskan untuk memenuhi \nkebutu\nhan \npembangunan yang disepakati \ndalam \nM\nusyawarah \nDesa\n \ndan sesuai dengan prioritas \nP\nemerintah\n \nDaerah\n \nKabupaten/Kota, Pemerintah \nDaerah Provinsi,\n \ndan \nP\nemerintah.\n \n(2)\n \nKebutuhan pembangunan\n \nsebagaimana dimaksud \npada ayat (1)\n \nmeliputi, tetapi tidak terbatas pada \nke\nbutuhan primer, \npelayanan dasar, lingkungan\n, \ndan \nkegiatan pemberdayaan\n \nmasyarakat Desa\n. \n \n \nPasal \n7\n5\n \n(1)\n \nKepala Desa\n \nadalah pemegang kekuasaan \npengelolaan \nK\neuangan \nDesa.\n \n(2)\n \nDalam melaksanakan kekuasaan sebagaimana \ndimaksud pada ayat (1), Kepala Desa menguasakan \nseb\nagian kekuasaannya kepada perangkat Desa.\n \n(3)\n \nKetentuan lebih lanjut mengenai Keuangan Desa \ndiatur dalam Peraturan Pemerintah.\n \n \nBagian \nKedua \n \nAset\n \nDesa\n \n \nPasal \n7\n6\n \n(1)\n \nAset Desa dapat berupa tanah kas Desa, tanah \nulayat, pasar Desa, pasar hewan, tambatan perahu, \nban\ngunan Desa, pelelangan ikan, pelelangan hasil \npertanian, hutan milik Desa, mata air milik Desa, \npemandian umum, dan aset lainnya milik Desa.\n \n \n \n \n(2) Aset \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n42 \n-\n \n \n(2)\n \nAset\n \nlainnya milik Desa \nsebagaimana dimaksud pada\n \na\nyat (1) antara lain:\n \na.\n \nkekayaan Desa\n \nyang dibeli atau diperole\nh atas \nbeban \nA\nnggaran \nPendapatan dan Belanja Negara, \nAnggaran Pendapatan dan Belanja Daerah, serta \nAnggaran Pendapatan dan Belanja Desa\n;\n \nb.\n \nkekayaan Desa \nyang diperoleh dari hibah\n \ndan \nsumbangan atau yang sejenis;\n \nc.\n \nkekayaan Desa \nyang diperoleh sebagai pelaksana\nan \ndari perjanjian/kontrak dan lain\n-\nlain sesuai dengan \nketentuan \nperaturan perundang\n-\nundangan;\n \nd.\n \nh\nasil kerja\n \nsama Desa\n; dan\n \ne.\n \nkekayaan Desa \nyang berasal dari perolehan \nlainnya\n \nyang sah.\n \n(3)\n \nKekayaan \nmilik \nP\nemerintah dan Pemerintah Daerah \nberskala lokal \nDesa\n \nyang a\nda di \nDesa dapat \ndihibahkan \nkepemilikannya kepada \nDesa\n.\n \n(4)\n \nKekayaan\n \nmilik\n \nDesa\n \nyang berupa tanah \ndisertifikatkan atas nama\n \nP\nemerintah \nDesa\n.\n \n(5)\n \nKekayaan \nmilik Desa yang telah diambil alih oleh \nPemerintah Daerah Kabupaten/Kota dikembalikan \nkepada Desa\n,\n \nkecuali yan\ng sudah digunakan untuk \nfasilitas \numum.\n \n(6)\n \nBangunan milik Desa harus dilengkapi dengan bukti \nstatus kepemilikan dan ditatausahakan secara tertib.\n \n \n \nPasal \n7\n7\n \n(1)\n \nPengelolaan kekayaan milik Desa dilaksanakan \nberdasarkan asas kepentingan umum, fungsional, \nkepastian \nhukum, keterbukaan, efisiensi, efektivitas, \nakuntabilitas, dan kepastian nilai ekonomi.\n \n(2)\n \nPengelolaan\n \nkekayaan milik\n \nDesa\n \ndilakukan\n \nuntuk \nmeningkatkan \nkesejahteraan\n \ndan\n \ntaraf hidup \nmasyarakat\n \nDesa serta meningkatkan pendapatan \nDesa. \n \n \n(3) Pengelolaan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n43 \n-\n \n \n(3)\n \nPengelolaan \nkekayaan m\nilik\n \nDesa \nsebagaimana \ndimaksud pada ayat (\n2\n) \ndibahas oleh Kepala Desa \nbersama Badan Permusyawaratan Desa berdasarkan \ntata cara pengelolaan kekayaan milik Desa yang \ndiatur dalam Peraturan Pemerintah.\n \n \nBAB \nI\nX\n \nPEMBANGUNAN DESA DAN PEMBANGUNAN KAWASAN \nPERDESAA\nN\n \n \nBagian Kesatu\n \nPembangunan Desa\n \n \nPasal \n7\n8\n \n(1)\n \nPembangunan Desa bertujuan meningkatkan \nkesejahteraan masyarakat Desa dan kualitas hidup \nmanusia serta penanggulangan kemiskinan melalui \npemenuhan kebutuhan dasar, pembangunan sarana \ndan prasarana Desa, pengemban\ngan potensi \nekonomi lokal, serta pemanfaatan sumber daya \nalam dan lingkungan secara berkelanjutan. \n \n(2)\n \nPembangunan Desa meliputi tahap perencanaan, \npelaksanaan, dan pengawasan.\n \n(3)\n \nPembangunan Desa sebagaimana dimaksud pada \nayat (2) mengedepankan kebersamaan, \nkek\neluargaan, dan kegotongroyongan guna \nmewujudkan pengarusutamaan perdamaian dan \nkeadilan sosial\n.\n \n \nParagraf \n1\n \nPerencanaan\n \nPasal \n7\n9\n \n(1)\n \nPemerintah Desa menyusun perencanaan \nPembangunan Desa sesuai dengan kewenangannya \ndengan mengacu pada perencanaan \npembangunan \nK\nabupaten/Kota.\n \n(2)\n \nPerencanaan Pembangunan Desa sebagaimana \ndimaksud pada ayat (1) disusun secara berjangka \nmeliputi:\n \na.\n \nRencana \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n44 \n-\n \n \na.\n \nRencana Pembangunan Jangka Menengah Desa \nuntuk jangka waktu 6 (enam) tahun; dan\n \nb.\n \nRencana Pembangunan Tahunan Desa atau yang \ndisebut Rencana Ke\nrja Pemerintah Desa, \nmerupakan penjabaran dari Rencana \nPembangunan Jangka Menengah Desa untuk \njangka waktu 1 (satu) tahun\n.\n \n(3)\n \nRencana Pembangunan Jangka Menengah \nDesa dan \nRencana Kerja Pemerintah \nDesa sebagaimana \ndimaksud pada ayat (2) ditetapkan dengan Perat\nuran \nDesa.\n \n(4)\n \nPeraturan Desa tentang Rencana Pembangunan \nJangka Menengah Desa dan Rencana Kerja \nPemerintah\n \nDesa\n \nmerupakan satu\n-\nsatunya dokumen \nperencanaan di Desa. \n \n(5)\n \nRencana Pembangunan Jangka Menengah \nDesa dan \nRencana Kerja Pemerintah\n \nDesa merupakan \npedoman d\nalam penyusunan Anggaran Pendapatan \ndan Belanja Desa yang diatur dalam Peraturan \nPemerintah.\n \n(6)\n \nProgram Pemerintah dan/atau Pemerintah Daerah \nyang berskala lokal Desa dikoordinasikan dan/atau \ndidelegasikan pelaksanaannya kepada Desa.\n \n(7)\n \nPerencanaan Pembangunan D\nesa sebagaimana \ndimaksud pada ayat (1) merupakan salah satu \nsumber masukan dalam perencanaan pembangunan \nKabupaten/Kota.\n \n \nPasal 80\n \n(1)\n \nPerencanaan Pembangunan Desa sebagaimana \ndimaksud dalam Pasal 79 diselenggarakan dengan \nmengikutsertakan masyarakat Desa.\n \n(2)\n \nDal\nam menyusun perencanaan Pembangunan Desa \nsebagaimana dimaksud pada ayat (1), Pemerintah \nDesa wajib menyelenggarakan musyawarah \nperencanaan Pembangunan Desa.\n \n \n(3) Musyawarah \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n45 \n-\n \n \n(3)\n \nMusyawarah perencanaan Pembangunan Desa \nmenetapkan prioritas, program, kegiatan, dan \nkebutuhan Pe\nmbangunan Desa yang didanai oleh \nAnggaran Pendapatan dan Belanja Desa, swadaya \nmasyarakat Desa, dan/atau Anggaran Pendapatan \ndan Belanja Daerah Kabupaten/Kota. \n \n(4)\n \nPrioritas, program, kegiatan, dan kebutuhan \nPembangunan Desa sebagaimana dimaksud pada \nayat (3)\n \ndirumuskan berdasarkan penilaian terhadap \nkebutuhan masyarakat Desa yang meliputi:\n \na.\n \npeningkatan kualitas dan akses terhadap \npelayanan dasar;\n \nb.\n \npembangunan dan pemeliharaan infrastruktur \ndan lingkungan berdasarkan kemampuan teknis \ndan sumber daya lokal yang t\nersedia;\n \nc.\n \npengembangan ekonomi pertanian berskala \nproduktif;\n \nd.\n \npengembangan dan pemanfaatan teknologi tepat \nguna untuk kemajuan ekonomi; dan\n \ne.\n \npeningkatan kualitas ketertiban dan \nketenteraman masyarakat Desa berdasarkan \nkebutuhan masyarakat Desa.\n \n \nParagraf \n2\n \nPe\nlaksanaan\n \n \nPasal 81\n \n(1)\n \nP\nembangunan Desa\n \ndilaksanakan\n \nsesuai dengan \nRencana Kerja \nP\nemerintah\n \nDesa\n.\n \n(2)\n \nP\nembangunan Desa\n \nsebagaimana dimaksud pada \nayat (1) dilaksanakan oleh \nP\nemerintah \nDesa\n \ndengan \nmelibatkan seluruh masyarakat Desa\n \ndengan \nsemangat gotong royong\n.\n \n(3)\n \nP\nelaksanaan \nP\nembangunan Desa\n \nsebagaimana \ndimaksud pada ayat (1) dilakukan dengan \nmemanfaatkan kearifan lokal dan sumber daya alam \nDesa.\n \n(4) Pembangunan \n. . .\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n-\n \n46 \n-\n \n \n(4)\n \n', '2017-03-26', 0);
